</head>
<body>
<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Esta es la pantalla principal del m&oacute;dulo.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="border-width: 1px; border-style: solid; width: 75%;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Estas son las opciones del panel izquierdo con sus respectivos funcionamientos y accesos:</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="border-width: 1px; border-style: solid;" /></p>

<ul>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Cursos Nuevos, permite ver los cursos nuevos programados, desde aqu&iacute; se pueden agregar participantes al adiestramiento, as&iacute; como suspender, reanudar o editar la informaci&oacute;n del mismo.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Cursos por Enviar a los Jefes, son aquellos cursos que est&aacute;n a la espera de cumplir los 90 d&iacute;as de ejecutados, y as&iacute; se env&iacute;e una notificaci&oacute;n a cada jefe de &aacute;rea v&iacute;a correo electr&oacute;nico inform&aacute;ndole que tiene personal adiestrado del cual debe llenar la encuesta de medici&oacute;n.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Cursos Ejecutados, es una lista de los cursos que fueron ejecutados hasta la fecha, all&iacute; se pueden modificar los participantes que asistieron.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Participantes por Evaluar, aqu&iacute; se presentan los cursos con participantes que est&aacute;n pendientes por evaluar, y la opci&oacute;n por cada uno para ejecutar la evaluaci&oacute;n.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Cursos Evaluados, se pueden ver los cursos evaluados y el detalle de cada uno, as&iacute; como la evaluaci&oacute;n realizada.</span></li>
</ul>

<p style="text-align: justify; margin-left: 40px;"><span style="font-family:verdana,geneva,sans-serif;"><span style="background-color:#ADD8E6;">Las 2 &uacute;ltimas opciones en este men&uacute; son las &uacute;nicas que est&aacute;n disponibles para los usuarios de tipo Jefe de &Aacute;rea.</span></span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Al hacer clic en esta opci&oacute;n se presenta la lista de cursos nuevos.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">En esta pantalla se puede:</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Ver/Agregar Participantes, se presenta una pantalla donde se seleccionan los empleados por empresa y departamento que participar&aacute;n en el adiestramiento.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Los participantes se agregan haciendo clic en la fila con la informaci&oacute;n de cada empleado y al desmarcarlos se excluyen del curso.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAB8AAAAYCAIAAACNybHWAAAAfklEQVRIie3MoQ3AIBCFYUY7gSRhGxJSxwRMQRMEBo9nADwKg2OC2oZcxSWt6j15+e8T68uJ/TBbCd4d9zkfSpvEBtN7sgqwKZs6ocH1aNA/AAATCQ3rrLPOOut/0pOVD4/SJkKD6zM7jf1K7fIkNLi+1ho1n/tyHeQG19/cBWQpMjwVERx3AAAAAElFTkSuQmCC" /> <span style="font-family:verdana,geneva,sans-serif;">Suspender y&nbsp;</span><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;"> Resumir Curso, permite suspender y evitar que sea tomado para los diferentes procesos, y reactivar el curso, para que siga todo el proceso normal.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /> <span style="font-family:verdana,geneva,sans-serif;">Completar Curso, permite indicar al sistema que ya el curso est&aacute; completo con los participantes e informaci&oacute;n y ser&aacute; colocado en pendientes por enviar a los jefes, despu&eacute;s de completar el curso no se puede revertir a su estado anterior.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /> <span style="font-family:verdana,geneva,sans-serif;">Editar el curso, abre una ventana flotante para editar toda la informaci&oacute;n del curso.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="border-width: 1px; border-style: solid; width: 35%;" /></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Al seleccionar esta opci&oacute;n se presenta la lista de cursos completados pendientes por enviar. Las opciones en este listado funcionan al igual que en el de cursos nuevos.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Al seleccionar esta opci&oacute;n se puede observar un listado de los cursos que se han ejecutado.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /> <span style="font-family:verdana,geneva,sans-serif;">Modificar Asistencia, esta opci&oacute;n permite editar si el participante asisti&oacute; o no al adiestramiento. Al hacer clic se presenta la siguiente pantalla, donde se puede indicar si asisti&oacute; o no al adiestramiento.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Al hacer presionar este bot&oacute;n se presentan los cursos pendientes por evaluar, donde se puede la fecha de env&iacute;o, la cantidad de participantes y cuantos renv&iacute;os se han realizado de las notificaciones a los jefes de &aacute;rea de los participantes involucrados.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n est&aacute; disponible s&oacute;lo para el personal de talento humano, permite ver, en una ventana flotante, la lista de empleados participantes del curso, divididos por departamentos y si ya ha sido evaluado, se puede ver la cantidad de puntos obtenidos en la encuesta y si aplica o no, esta es la lista que se puede observar al momento de seleccionar esta opci&oacute;n.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 50%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n es s&oacute;lo visible para los usuarios del tipo jefe de &aacute;rea, permite ingresar a la lista de empleados de los departamentos asignados al jefe que inicio sesi&oacute;n, permitiendo que realice la evaluaci&oacute;n respectiva del adiestramiento. Al hacer clic en esta opci&oacute;n se presenta la siguiente pantalla.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n es para modificar la condici&oacute;n del paciente, para indicar el motivo por el cual no se puede realizar la evaluaci&oacute;n. Al hacer cli aqu&iacute; se presenta la ventana flotante con las opciones necesarias, la pantalla es la siguiente.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 35%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">En esta ventana se modifica el motivo por el cual no se puede realizar la evaluaci&oacute;n, entre las opciones o motivos que se encuentran en la lista son:</span></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Vacaciones, Reposo, Renuncia y Quitar Motivo, este &uacute;ltimo limpia el motivo en caso de ser necesario para poder evaluar al participante.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n permite ejecutar la evaluaci&oacute;n respectiva del empleado de la eficacia del adiestramiento, al hacer clic se presenta la pantalla con la evaluaci&oacute;n correspondiente al tipo de medici&oacute;n indicada al momento de crear el curso o adiestramiento, en la cual se deben responder las preguntas dispuestas.</span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n permite listar los cursos evaluados, s&oacute;lo ser&aacute;n visibles aquellos cursos que tienen evaluados a todos los participantes, al hacer clic en esta opci&oacute;n se lista la pantalla siguiente.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n de la lista permite ver la lista de los empleados evaluados con la puntuaci&oacute;n obtenida, si aplica, o las siglas n/a que indican que el adiestramiento no aplica a las funciones del empleado, al hacer clic se presenta la siguiente ventana.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Ver Evaluaci&oacute;n, permite ver la evaluaci&oacute;n realizada por el jefe de &aacute;rea, con las respuestas seleccionadas al momento de ejecutar la evaluaci&oacute;n.</span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Opciones del panel derecho con sus respectivos funcionamientos y accesos.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="border-width: 1px; border-style: solid;" /></p>

<ul>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Inicio Intranet, este bot&oacute;n permite regresar al men&uacute; principal de Intranet, para permitir cambiar de &aacute;rea.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Inicio, permite regresar al inicio del m&oacute;dulo de Medici&oacute;n de Eficacia de Adiestramiento.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Nuevo Curso, desde esta opci&oacute;n se presenta una ventana flotante para ingresar los datos necesarios para crear un nuevo adiestramiento o curso.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Conf. Jefes, esta opci&oacute;n permite realizar la configuraci&oacute;n de los jefes de &aacute;rea, indicando el nombre del jefe, correo electr&oacute;nico y asignaci&oacute;n de departamentos a cargo.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Estad&iacute;sticas, permite generar los indicadores ISO de gesti&oacute;n de Talento Humano por trimestre y a&ntilde;o, estos resultados se pueden exportar a Excel.</span></li>
	<li style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Adiestramiento, genera un calendario de adiestramientos agendados por trimestre y a&ntilde;o, se puede exportar a Excel.</span></li>
</ul>

<p style="text-align: justify; margin-left: 40px;"><span style="font-family:verdana,geneva,sans-serif;"><span style="background-color:#ADD8E6;">Las 2 primeras opciones en este men&uacute; son las &uacute;nicas que est&aacute;n disponibles para los usuarios de tipo Jefe de &Aacute;rea.</span></span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n presenta una ventana flotante que solicita los datos necesarios para crear un nuevo curso, la pantalla que se presenta es la siguiente.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 35%; border-width: 1px; border-style: solid;" /></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n presenta una lista de los cargos de intranet para que se ingrese la informaci&oacute;n referente al jefe y asignar los departamentos atados al cargo de intranet seleccionado. Al hacer clic se presenta la siguiente informaci&oacute;n.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAC8AAAAsCAIAAAB60XZVAAAAo0lEQVRYhe3OMQqEMBSEYY/2ipSCtxHCdjmBp1CwSJPe3gPYW9mkywm2XSUjPHi4FvPXA/M15U01/wacogZHDY4aHDU4anDU4O41eVvGIXx+C8O4bFm5sdDs0bdSq/VxV2xsNHNf/RER6WfFhhpqqKGGGmqooYaaWtE7cOR8VGxsNDmFrvblupCyYmOjKaUca5qupfVQb2w0D0cNjhocNbh3ab4xM93WjRJN6gAAAABJRU5ErkJggg==" /><span style="font-family:verdana,geneva,sans-serif;">&nbsp;Esta opci&oacute;n permite deshabilitar el cargo de jefe de intranet.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," />&nbsp; <span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n habilita el cargo de jefe de intranet.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /> <span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n presenta una ventana flotante para ingresar informaci&oacute;n del jefe del &aacute;rea, al hacer clic se presenta esta pantalla.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 35%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /> <span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n presenta la lista de departamentos filtrados por empresa, que se pueden asignar al cargo de intranet seleccionado, al hacer clic en la fila se asigna o se quita al jefe seleccionado al departamento.</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Aqu&iacute; se ven los departamentos sin jefe asignado y al final de la lista los que ya estan asignado con el jefe correspondiente, en caso de que se haya asignado mal.</span></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Para modificar se debe seleccionar en la lista anterior el cargo y luego modificar los departamentos asignados.</span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">Para poder generar los indicadores necesarios para el departamento con respecto a la Medici&oacute;n de la Eficacia del Adiestramiento, se debe seleccionar esta opci&oacute;n y se presentar&aacute; la aiguiente pantalla</span></p>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," style="width: 75%; border-width: 1px; border-style: solid;" /></p>

<p style="text-align: justify;"><span style="font-family:verdana,geneva,sans-serif;">En esta ventana se pueden generar los indicadores seleccionando el Trimetre y a&ntilde;o a consultar, y tiene la opci&oacute;n de exportar dichos resultados a Excel.</span></p>

<div style="page-break-after: always"><span style="display: none;">&nbsp;</span></div>

<p style="text-align: justify;"><img alt="" src="data:image/png;base64," /><span style="font-family:verdana,geneva,sans-serif;">Esta opci&oacute;n permite presentar la programaci&oacute;n de los cursos de un trimetre dado.</span></p>
</body>
</html>
